package codingPrograms;public class FibonaciSeriesUpto {    public static void main(String...args){        printFibonacci(5);    }    private static void printFibonacci(int n){       int num1 = 0;       int num2 = 1;        System.out.print(" "+num1);        System.out.print(" "+num1);       for(int i = 0;i <n-2;i++){           int num3 = num1+num2;           System.out.print(" "+num3);           num1 = num2;           num2 = num3;       }    }}